import React from "react";
import data from "../data";

function ArrayMainScreen(props) {

    return (
        <div className="algorithms">
            <p>Select an algorithm you want to see!</p>
            {
                data.algorithms.map(algorithm =>
                        <div key={algorithm._id}>
                            <button className="btn" type="button" data-toggle="collapse" data-target="#collapseTest" aria-expanded="false" aria-controls="collapseTest">
                                {algorithm.name}
                            </button>
                            <div className="collapse" id="collapseTest">
                                <div className="card card-body">
                                </div>
                            </div>
                        </div>)

            }
        </div>

    )
}

export default ArrayMainScreen;
